import React, { useState, useEffect } from 'react';
import axios from 'axios';
import Level1 from '../level1/Level1';

const Level1ContentCard = (props) => {
	const content = props.content;

	return (
		<div>
			<h2>{content.title}</h2>
		</div>
	);
};

export default Level1ContentCard;
